import React from 'react';
import { Link } from 'react-router-dom'; // Import Link to navigate
import './MainPage.css';

const MainPage = () => {
  return (
    <div className="main-page">
      <h1>Welcome to the Algorithm Visualizer!</h1>
      {/* Link to the App component (the actual visualizations) */}
      <Link to="/visualizer">
        <button className="start-button">Go to Visualizer</button>
      </Link>
    </div>
  );
};

export default MainPage;
